webpackJsonp([0x60504a6ab838],{449:function(A,t){A.exports={data:{markdownRemark:{html:'<p>Evolving better unit combat AI.</p>\n<!-- end excerpt -->\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/emapf-5c651db2a9385df51de652d610305975-f3a32.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 700px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 57.14285714285714%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="thumbnail"\n        title=""\n        src="/static/emapf-5c651db2a9385df51de652d610305975-f3a32.jpg"\n        srcset="/static/emapf-5c651db2a9385df51de652d610305975-6ba01.jpg 175w,\n/static/emapf-5c651db2a9385df51de652d610305975-b8ff8.jpg 350w,\n/static/emapf-5c651db2a9385df51de652d610305975-f3a32.jpg 700w"\n        sizes="(max-width: 700px) 100vw, 700px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p><a href="https://bitbucket.org/ratiotile/emapf">https://bitbucket.org/ratiotile/emapf</a></p>\n<p>Uses genetic algorithms to learn unit combat micro in Starcraft. Ported from an existing C# project, with improvements.</p>\n<ul>\n<li>Potential Fields(PF) for agent behavior</li>\n<li>Tuning variables on aspects of PF</li>\n<li>Fitness is the surviving units/health in combat scenario</li>\n<li>Use crossover and mutation to explore search space</li>\n<li>Elitism added to avoid losing good solutions</li>\n<li>Best solutions found are much better than control(attack-nearest heuristic)</li>\n<li>Learns kiting behavior when units have longer range</li>\n</ul>',frontmatter:{date:"March 26, 2015",path:"/projects/emapf",title:"Evolutionary Multi-Agent Potential Fields"}}},pathContext:{}}}});
